import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Objects;
import java.util.concurrent.*;

public class ForkJoinPoolLimit {

	// can reduce threads number by using -Djava.util.concurrent.ForkJoinPool.common.parallelism=2
	public static void main(String[] args) throws Exception {
		ForkJoinPool forkJoinPool = ForkJoinPool.commonPool();
		List<ForkJoinTask<?>> tasks = new ArrayList<>();
		for (int i = 0; i < forkJoinPool.getParallelism(); i++) {
			tasks.add(forkJoinPool.submit(() -> hangPlease(true, forkJoinPool)));			
			Thread.sleep(100);
		}
		System.out.println("\nNext *not* hanging task should be executed?\n");
		tasks.add(forkJoinPool.submit(() -> hangPlease(false, forkJoinPool)));

		printPoolInfo(forkJoinPool);

		for (ForkJoinTask<?> forkJoinTask : tasks) {
			forkJoinTask.get();
		}
	}

	private static void hangPlease(boolean hang, ForkJoinPool forkJoinPool) {
		System.out.println("\nStarting hang");
		printPoolInfo(forkJoinPool);
		ArrayList<PerProjectInfo> infos = new ArrayList<>();
		infos.add(new PerProjectInfo(hang));
		Exception[] stats = null;
		try {
			stats = forkJoinPool.submit(() -> infos.stream().parallel().map(info -> {
				try {
					saveState(info);
				} catch (Exception e) {
					return e;
				}
				return null;
			}).filter(Objects::nonNull).toArray(Exception[]::new)).get();
		} catch (InterruptedException | ExecutionException e) {
			e.printStackTrace();
		} finally {
			forkJoinPool.shutdown();
		}
		System.out.println(Arrays.toString(stats));
	}

	private static void printPoolInfo(ForkJoinPool forkJoinPool) {
		System.out.println("Parallelism " + forkJoinPool.getParallelism());
		System.out.println("ActiveThreadCount " + forkJoinPool.getActiveThreadCount());
		System.out.println("PoolSize " + forkJoinPool.getPoolSize());
		System.out.println("RunningThreadCount " + forkJoinPool.getRunningThreadCount());
	}

	private static void saveState(PerProjectInfo info) throws Exception {
		try {			
			info.save();
		} catch (Exception e) { 
			e.printStackTrace();
		}
	}
}

class PerProjectInfo {

	private boolean hang;

	public PerProjectInfo(boolean shouldSleep) {
		this.hang = shouldSleep;
	}

	void save() throws Exception {
		if(hang) {
			System.out.println("\nSleep begins");
			synchronized (this) {
				wait(30_000);
			}
			System.out.println("Sleep done");
		} else {
			System.out.println("\n!!!!!!!!!!!!!\nRegular save!\n!!!!!!!!!!!!!");			
		}
	}
}

